export function Passions() {
  return (
    <section class="passetemps">
      <div className="cat">
        <h5>Things I like</h5>
        <ul id="my-list">
          <li>Playing Piano</li>
          <li>Climbing</li>
          <li>Cooking</li>
        </ul>
      </div>
    </section>
  );
}
